import {ADD_TODO,DELETE_TODO,ERRORS,UPDATE_TODO,GET_TODOS,GET_TODO} from './types'

const initialState = {
  items: null,
  item: null,
  loading: false,
  error: null,
};

export default (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};
